import React, { useEffect, useState } from "react";
import useAuth from "../hooks/useAuth";

function LogoutPage() {
  if (useAuth() === true) {
    useEffect(() => {
      fetch("/logout")
        .then((res) => Response.json())
        .then((window.location.href = "/index"));
    }, []);
  } else {
    return <div>LogoutPage</div>;
  }
}

export default LogoutPage;
